function CampanhaCarrossel(){
  const[cur,setCur]=useState(0);
  const[paused,setPaused]=useState(false);
  const total=CAMPAIGN_SLIDES.length;
  useEffect(()=>{if(paused)return;const t=setInterval(()=>setCur(c=>(c+1)%total),3800);return()=>clearInterval(t);},[paused,total]);
  const nav=(dir)=>{setCur(c=>(c+dir+total)%total);setPaused(true);setTimeout(()=>setPaused(false),6000);};
  const slide=CAMPAIGN_SLIDES[cur];
  return(
    <div>
      <div onMouseEnter={()=>setPaused(true)} onMouseLeave={()=>setPaused(false)}
        style={{borderRadius:16,overflow:"hidden",border:"2px solid #EDE9FE",position:"relative",background:"#fff",boxShadow:"0 8px 32px rgba(107,33,168,.12)"}}>
        <img src={slide.src} alt={slide.label} style={{width:"100%",display:"block",transition:"opacity .4s ease"}} />
        <div style={{position:"absolute",top:12,right:12,background:"rgba(107,33,168,.85)",backdropFilter:"blur(8px)",borderRadius:100,padding:"5px 14px",fontFamily:"'Outfit',sans-serif",fontSize:11,fontWeight:600,color:"#fff",letterSpacing:".08em"}}>
          {cur+1}/{total}  {slide.label}
        </div>
        <button onClick={()=>nav(-1)} style={{position:"absolute",left:10,top:"50%",transform:"translateY(-50%)",background:"rgba(255,255,255,.9)",border:"none",borderRadius:"50%",width:36,height:36,cursor:"pointer",fontSize:18,color:"#6B21A8",display:"flex",alignItems:"center",justifyContent:"center",boxShadow:"0 2px 8px rgba(0,0,0,.15)"}}></button>
        <button onClick={()=>nav(1)} style={{position:"absolute",right:10,top:"50%",transform:"translateY(-50%)",background:"rgba(255,255,255,.9)",border:"none",borderRadius:"50%",width:36,height:36,cursor:"pointer",fontSize:18,color:"#6B21A8",display:"flex",alignItems:"center",justifyContent:"center",boxShadow:"0 2px 8px rgba(0,0,0,.15)"}}></button>
      </div>
      <div style={{display:"flex",alignItems:"center",justifyContent:"center",gap:6,marginTop:14}}>
        {CAMPAIGN_SLIDES.map((_,i)=>(<button key={i} className="carousel-dot" onClick={()=>{setCur(i);setPaused(true);setTimeout(()=>setPaused(false),6000);}} style={{background:i===cur?"#6B21A8":"#DDD6FE",transform:i===cur?"scale(1.4)":"scale(1)"}}/>))}
      </div>
      <p style={{fontFamily:"'Outfit',sans-serif",fontSize:11,color:"#C4B5FD",textAlign:"center",marginTop:8}}>Passe o mouse para pausar  Use as setas para navegar</p>
    </div>
  );
}

